INSERT INTO `hotel` (`id_hotel`, `nombre`, `descripcion`, `ubicacion`, `imagen`, `reporte`) VALUES
(46, 'Hotel Utama', 'El Hotel Utama está situado a 400 metros de la península de Copacabana. Dispone de habitaciones con vistas al lago Titicaca y baño privado con agua caliente. También ofrece conexión Wi-Fi gratuita y servicio de traslado gratuito de ida y vuelta a la estación de autobuses.\nLas habitaciones del Hotel Utama están equipadas con TV por cable. Las habitaciones superiores, además, incluyen sofás y vistas al lago.', 'https://g.page/Hotel-UTAMA?share', , '');
INSERT INTO `hotel` (`id_hotel`, `nombre`, `descripcion`, `ubicacion`, `imagen`, `reporte`) VALUES
(54, 'Hotel Rosario Lago Titicaca', 'El Rosario del Lago ofrece habitaciones de arquitectura colonial con vistas al lago Titicaca, en Bolivia. Alberga una tienda de artesanía y un restaurante que sirve trucha y una selección de vinos bolivianos exquisitos.\r\nEn el jardín del Hotel Rosario del Lago podrá degustar una barbacoa mientras disfruta de las vistas al lago. También se ofrecen platos vegetarianos.\r\nEl establecimiento dispone también de conexión a internet y de un mostrador de información turística. Si desea relajarse, el hotel cuenta con una sala de juegos y un salón con chimenea.\r\nLas habitaciones del Rosario del Lago están equipadas con TV por cable, teléfono y calefacción. Además, podrá disfrutar de una taza de té caliente en cualquier momento.', 'https://g.page/hotel-rosario-lago-titicaca?share', , '');
INSERT INTO `hotel` (`id_hotel`, `nombre`, `descripcion`, `ubicacion`, `imagen`, `reporte`) VALUES
(55, 'Hotel Cupula', 'El Hotel La Cupula se encuentra en Copacabana, a 300 metros del Calvario, y ofrece restaurante, jardín y vistas al lago. Ofrece habitaciones familiares y barbacoa. Hay recepción 24 horas, servicio de traslado, servicio de conserjería y WiFi gratuita en todas las instalaciones.\r\nTodas las habitaciones están equipadas con baño privado con ducha y algunas tienen zona de cocina.\r\nEl hotel sirve un desayuno americano a diario.\r\nEl Hotel La Cupula alberga un solárium.\r\nEn las inmediaciones hay varios lugares de interés, como el mercado de Copacabana, la catedral de Nuestra Señora de Copacabana y la horca del Inca.', 'https://goo.gl/maps/tT1Z3aVsC3cffrQW6', , '');

